import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import * as API from '../services/api';

function EditPage() {
  const navigate = useNavigate();
  const [transactions, setTransactions] = useState([]);
  const [form, setForm] = useState({ description: '', amount: '', category: '' });
  const [error, setError] = useState('');
  const [defaultUser, setDefaultUser] = useState(null);

  // Load transactions
  const load = () => {
    if (!defaultUser) return;
    API.getTransactions()
      .then((data) => setTransactions(data))
      .catch(() => setTransactions([]));
  };

  // Load default user on mount
  useEffect(() => {
    API.getDefaultUser()
      .then(user => {
        setDefaultUser(user);
        load();
      })
      .catch(err => console.error(err));
  }, []);

  // Add a transaction
  const submit = () => {
    if (!defaultUser) {
      setError('Default user not loaded yet.');
      return;
    }

    const payload = {
      description: form.description,
      amount: parseFloat(form.amount),
      category: form.category,
      type: parseFloat(form.amount) >= 0 ? 'income' : 'expense',
      user: defaultUser._id
    };

    API.addtransaction(payload)
      .then(() => {
        setForm({ description: '', amount: '', category: '' });
        setError('');
        load();
      })
      .catch(err => {
        console.error(err.response?.data || err);
        setError(err.response?.data?.error || 'Error adding transaction');
      });
  };

  // Delete a transaction
  const remove = (id) => {
    API.deleteTransaction(id)
      .then(() => load())
      .catch(err => console.error(err.response?.data || err));
  };

  return (
    <div style={{ padding: 20 }}>
      <h1>Edit Transactions</h1>
      <button onClick={() => navigate('/')}>Back</button>

      <h3 style={{ marginTop: 20 }}>Add Transaction</h3>
      {error && <div style={{ color: 'red', marginBottom: 10 }}>{error}</div>}
      <input
        placeholder="Description"
        value={form.description}
        onChange={(e) => setForm({ ...form, description: e.target.value })}
      />
      <input
        placeholder="Amount"
        type="number"
        value={form.amount}
        onChange={(e) => setForm({ ...form, amount: e.target.value })}
      />
      <input
        placeholder="Category"
        value={form.category}
        onChange={(e) => setForm({ ...form, category: e.target.value })}
      />
      <button style={{ marginLeft: 10 }} onClick={submit}>Add</button>

      <h3 style={{ marginTop: 30 }}>Existing Transactions</h3>
      {transactions?.length > 0 ? (
        transactions.map(t => (
          <div key={t._id} style={{ background: 'white', padding: 10, marginBottom: 6 }}>
            <div><strong>Description:</strong> {t.description || '—'}</div>
            <div><strong>Amount:</strong> ${t.amount != null ? t.amount.toFixed(2) : '0.00'}</div>
            <div><strong>Type:</strong> {t.type || '—'}</div>
            <div><strong>Category:</strong> {t.category || '—'}</div>
            <button style={{ marginTop: 4 }} onClick={() => remove(t._id)}>Delete</button>
          </div>
        ))
      ) : (
        <div>No transactions found.</div>
      )}
    </div>
  );
}

export default EditPage;
